class Counter extends React.Component {
    state = {
        mainTitle: "Machbazaar.com",
        subTitle: "Online fish selling platform.",
        cartCount: 0
    };
    render(){ 
        return (
            //we can add <React.Fragment> instead of <div></div> if we don't want this blank div
            <div className="container">
                <div className="row">
                    <div className="col-md-12 text-left mt-4">
                        <h1 className="font-weight-bold">{this.state.mainTitle}</h1>
                        <h4>Online fish selling platform.</h4>
                    </div>  

                    <a type="button" className="btn btn-success text-white text-right">
                      <i className="fa fa-cart"> Cart </i>
                    </a>  
                </div>
            </div>
        ); 
    }


}

